tables.table_schema:
CREATE TABLE Backlinks (
    backlink_id SERIAL PRIMARY KEY,
    backlink_url TEXT NOT NULL,
    anchor_text TEXT,
    referring_domain TEXT,
    target_url TEXT,
    created_at TIMESTAMP
);

CREATE TABLE ReferringDomains (
    domain_id SERIAL PRIMARY KEY,
    domain_name TEXT NOT NULL,
    domain_rating INT,
    created_at TIMESTAMP
);

CREATE TABLE AnchorTexts (
    anchor_id SERIAL PRIMARY KEY,
    anchor_text_value TEXT NOT NULL,
    backlink_id INT,
    created_at TIMESTAMP
);

CREATE TABLE TargetPages (
    target_id SERIAL PRIMARY KEY,
    target_url TEXT NOT NULL,
    target_rating INT,
    created_at TIMESTAMP
);
